import React from 'react';

const FlagUa = props => (
  <svg viewBox="0 0 1200 800" {...props}>
    <path fill="#005BBB" d="M0 0h1200v800H0z" />
    <path fill="#FFD500" d="M0 400h1200v400H0z" />
  </svg>
);

export default FlagUa;
